import { memo } from 'react';

// export แบบเป็น ชิ้น
export const CounterA = ({ count }: { count: number }) => {
  console.log('Log Inside Counter Component A:', count);
  return <div className='counter'>Counter: {count}</div>;
};

export const CounterB = memo(() => {
  console.log('Log Inside Counter Component B:');
  return <div className='counter'>Counter: B</div>;
});
